import React from "react";

function ItemCard(props) {
  return (
    <div>
      props.item.map(data => (
      <div key={data.id}>
        <div
          className="item"
          style={{
            width: 128,
            height: 188,
            backgroundImage: `url(${data.img_url})`
          }}
        ></div>
      </div>
      ))
    </div>
  );
}
export default ItemCard;
